import React from "react";

function Form(){
    return(
        <>
            <label>Nome</label>
            <input />
            <label>Idade</label>
            <input />
            <label>E-mail</label>
            <input />
            <label>Senha</label>
            <input />
            <label>Telefone</label>
            <input />
        </>
       
    )
}

export default Form;
